function download($path) {
 session_write_close()\x3B
 ob_end_clean()\x3B
 if (!is_file($path) || connection_status()!=0)
 return(FALSE)\x3B

 //to prevent long file from getting cut off from //max_execution_time

 set_time_limit(0)\x3B

 $name=basename($path)\x3B

 // Required for some browsers
 if(ini_get(\x27zlib.output_compression\x27))
 ini_set(\x27zlib.output_compression\x27\x2C \x27Off\x27)\x3B
 
 //filenames in IE containing dots will screw up the
 //filename unless we add this

 if (strstr($_SERVER[\x27HTTP_USER_AGENT\x27]\x2C \x22MSIE\x22))
 $name = preg_replace(\x27/\x5C./\x27\x2C \x27%2e\x27\x2C $name\x2C substr_count($name\x2C \x27.\x27) - 1)\x3B

 //required\x2C or it might try to send the serving //document instead of the file
 header(\x22Cache-Control: \x22)\x3B
 header(\x22Pragma: \x22)\x3B
 header(\x22Content-Type: application/octet-stream\x22)\x3B
 header(\x22Content-Length: \x22 .(string)(filesize($path)) )\x3B
 header(\x27Content-Disposition: attachment\x3B filename=\x22\x27.$name.\x27\x22\x27)\x3B
 header(\x22Content-Transfer-Encoding: binary\x5Cn\x22)\x3B

 if($file = fopen($path\x2C \x27rb\x27)){
 while( (!feof($file)) \x26\x26 (connection_status()==0) ){
 print(fread($file\x2C 1024*8))\x3B
 flush()\x3B
 }
 fclose($file)\x3B
 }
 return((connection_status()==0) and !connection_aborted())\x3B
}

