 //to prevent long file from getting cut off from //max_execution_time
 set_time_limit(0)\x3B

 $name=basename($path)\x3B

 // Required for some browsers
 if(ini_get(\x27zlib.output_compression\x27))
 ini_set(\x27zlib.output_compression\x27\x2C \x27Off\x27)\x3B
 
 //filenames in IE containing dots will screw up the
 //filename unless we add this
 if (strstr($_SERVER[\x27HTTP_USER_AGENT\x27]\x2C \x22MSIE\x22))
 $name = preg_replace(\x27/\x5C./\x27\x2C \x27%2e\x27\x2C $name\x2C substr_count($name\x2C \x27.\x27) - 1)\x3B

 // http headers for zip downloads
 header(\x22Pragma: public\x22)\x3B
