function export2csv($rows\x2C $del\x2C $zip=false)

// This function takes the selected rows and the field delimiter
// to save a csv-file on the server
 
{
 global $ff_compath\x3B
 // set the filename to a kind of unique
 // in the exports directory under com_facileforms
 $filename = \x27export-\x27.date(\x27YmdHis\x27)\x3B
 $filepath = \x27../exports/\x27.$filename\x3B
 $existed = file_exists($filepath.\x27.csv\x27)\x3B // test the file
 if ($existed) {
 $permission = is_writable($filepath.\x27.csv\x27)\x3B
 if (!$permission) {
 $dienow = $error==FF_DIE\x3B
 $error = \x22Fehler beim Schreiben der Datei \x22.$filepath.\x27.csv\x27\x3B
 if ($dienow) ff_die($error)\x3B
 return NULL\x3B
 } // if
 } // if
 $file=fopen($filepath.\x27.csv\x27\x2C \x22w\x22)\x3B
 if (!($del)) $del=\x22\x3B \x22\x3B // set delimiter to a default value if not set...
 $data=\x22\x22\x3B // var to hold the processed results
 // lines in the csv file
 foreach ($rows as $row) {
 // only the first field does not get a delimiter
 $writeDelimiter = FALSE\x3B
 // fields in the csv file
 foreach ($row as $field) {
 // Replaces a double quote with two double quotes
 $field=str_replace(\x22\x5C\x22\x22\x2C \x22\x5C\x22\x5C\x22\x22\x2C $field)\x3B
 // Adds a delimiter before each field (except the first)
 if($writeDelimiter) $data .= $del\x3B
 $data .= $field\x3B
 $writeDelimiter = TRUE\x3B
 } // foreach
 // add a newline to every line
 $data .= \x22\x5Cr\x5Cn\x22\x3B
 } // foreach
 fwrite($file\x2C $data)\x3B
 fclose($file)\x3B
 if($zip){
 $z=new ZipArchive()\x3B
 $res = $z-\x3Eopen($filepath.\x27.zip\x27\x2C ZipArchive::CREATE)\x3B
 if ($res === TRUE) {
 if(!$z-\x3EaddFile($filepath.\x27.csv\x27\x2C$filename.\x27.csv\x27)){
 ff_die(\x22Die Datei \x22.$filepath.\x22.csv konnte dem Archiv nicht hinzugefügt werden.\x22)\x3B
 }
 if($z-\x3Eclose()){
 unlink($filepath.\x27.csv\x27)\x3B
 return $filepath.\x27.zip\x27\x3B
 } 
 else{
 unlink($filepath.\x27.csv\x27)\x3B
 ff_die(\x22Die Exportdatei \x22.$filepath.\x22.zip konnte nicht erzeugt werden.\x22)\x3B
 } 
 }
 }
 else
 return $filepath.\x27.csv\x27\x3B
} // end function

piece.description:
Returns submitdata either as scalar\x2C array or list. In case of list the values
are returned as a string with the values concatenated by comma.

Examples:

// Get as scalar: Optionally pass a default value as second parameter.
// If no default is provided\x2C it will return NULL if no value was submitted

 $myval = getSubmit(\x27myvar\x27)\x3B // return NULL if not submitted

 $myval = getSubmit(\x27myvar\x27\x2C1)\x3B // return 1 if not submitted

 $myval = getSubmit(\x27myvar\x27\x2C\x27foo\x27)\x3B // return \x27foo\x27 if not submitted

 ff_query(
 \x22insert into #__mytable(id\x2C name) \x22.
 \x22values (\x27\x22.
 getSubmit(\x27id\x27).\x22\x2C \x22.
 getSubmit(\x27name\x27\x2C\x27unknown\x27).
 \x22\x27)\x22
 )\x3B

// Get as array: Pass FF_ARRAY as second Parameter

 $myarr = getSubmit(\x27myarr\x27\x2C FF_ARRAY)\x3B

 foreach ($myarr as $myval) ...

// Get as list: Pass either FF_LIST\x2C FF_SLIST or FF_DLIST as 2nd parameter.

 // FF_LIST will return numeric data unquoted and strings in single quotes:
 // 1\x2C2\x2C\x27a\x27\x2C4

 // FF_SLIST will return all data single quoted:
 // \x271\x27\x2C\x272\x27\x2C\x27a\x27\x2C\x274\x27

 // FF_DLIST will return all data double quoted:
 // \x221\x22\x2C\x222\x22\x2C\x22a\x22\x2C\x224\x22

 ff_query(
 \x22delete from #__mytable \x22.
 \x22where id in (\x22.getSubmit(\x27itemlist\x27\x2CFF_LIST).\x22)\x22
 )\x3B

piece.code:
function getSubmit($name\x2C $default=null)
{
 global $ff_processor\x3B

 switch ((string)$default) {
 case FF_ARRAY: $value = array()\x3B break\x3B
 case FF_LIST : 
 case FF_SLIST:
 case FF_DLIST: $value = \x27\x27\x3B break\x3B
 default : $value = $default\x3B
 } // switch
 if(count($ff_processor-\x3Esubmitdata)){
 foreach ($ff_processor-\x3Esubmitdata as $data){
 if ($data[_FF_DATA_NAME]==$name) {
 $q = \x27\x27\x3B
 switch ((string)$default) {
 case FF_ARRAY:
 $value[] = $data[_FF_DATA_VALUE]\x3B
 break\x3B
 case FF_SLIST:
 $q = \x22\x27\x22\x3B
 case FF_DLIST:
 if ($q==\x27\x27) $q = \x27\x22\x27\x3B
 case FF_LIST:
 if ($q==\x27\x27 \x26\x26 !is_numeric($data[_FF_DATA_VALUE])) $q = \x22\x27\x22\x3B
 if ($value!=\x27\x27) $value.=\x27\x2C\x27\x3B
 $value .= $q.$data[_FF_DATA_VALUE].$q\x3B
 break\x3B
 default:
 return $data[_FF_DATA_VALUE]\x3B
 } // switch
 } // if
 } //foreach
 } // if
 return $value\x3B
} // getSubmit

function getValue($name\x2C$default=\x27\x27)
{
 global $ff_processor\x3B
 for ($r = 0\x3B $r \x3C $ff_processor-\x3Erowcount\x3B $r++) {
 $row =\x26 $ff_processor-\x3Erows[$r]\x3B
 ff_die(print_r(ff_processor-\x3Erows\x2Ctrue))\x3B
 if ($row-\x3Ename==$name){
 return $row-\x3Edata1\x3B
 }
 } // for
 return $default\x3B
} // getValue

function setRadioGroup($name\x2C $value)
{
 global $ff_processor\x3B
 for ($r = 0\x3B $r \x3C $ff_processor-\x3Erowcount\x3B $r++) {
 $row =\x26 $ff_processor-\x3Erows[$r]\x3B
 if ($row-\x3Ename==$name)
 $row-\x3Edata2 = $value\x3B
 unset($row)\x3B
 } // for
} // setRadioGroup

